import axios from "axios";
import { API } from "../utils/config";

export const insertWirehouse = (data) => {
    //alert(`${Object.keys (data)} = ${Object.values(data)}`);
        return axios.post(`${API}/create/wirehouse`, data, {
        headers: {
            "Content-Type": "application/json",
        }
    })
}

export const getAllWirehouse = () => {
    return axios.get(`${API}/getall/wirehouse`)
}


export const getWirehouseById = (id) => {
    return axios.get(`${API}/wirehouse/${id}`)
}

export const updateWirehouseById = (data,id) => {
    return axios.put(`${API}/update/wirehouse/${id}`, data, {
        headers: {
            "Content-Type": "application/json"
        }
    })
}

export const deleteWirehouseById = (id) => {
    return axios.delete(`${API}/wirehouse/${id}`)
}
